import React from 'react';
import logo from './images/logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header>
        <nav>
          <ul>
              <li><a href="home">Portfolio</a></li>
              <li><a href="blog">About</a></li>
          </ul>
        </nav>
      </header>
      <div className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </div>
    </div>
  );
}

export default App;
